import { useEffect } from 'react';
import { HeaderModel } from '../model/header';
import { Heading, Text, Input, InputGroup, InputLeftElement, FormControl, FormLabel, Box } from '@chakra-ui/react';
import { PhoneIcon } from "@chakra-ui/icons";
import './headerComponent.css'
function Header() {
    useEffect(() => {

        const getHeader = async() => {
          let headerModel = new HeaderModel()
          let header = await headerModel.getHeader()
          console.log(header[0])
        }

        getHeader()
      }, [])


    return (
        <div>
            {/* <Text>First Name</Text>
            <Text>Last Name</Text>
            <Text>Catchy Headline</Text>
            <Text>Location City, State</Text>
            <Text>Phone Number</Text> */}

            <FormControl>
                <Box>
                    <FormLabel>First Name</FormLabel>
                    <Input placeholder='First Name'></Input>
                </Box>


                <Box>
                    <FormLabel>Last Name</FormLabel>
                    <Input placeholder='Last Name'></Input>
                </Box>

                <Box>
                    <FormLabel>Catchy Headline</FormLabel>
                    <Input placeholder='Catchy Headline'></Input>
                </Box>

                <Box>
                    <FormLabel>City, State</FormLabel>
                    <Input placeholder='City, State'></Input>
                    <InputGroup>
                        <InputLeftElement pointerEvents='none'>
                            <PhoneIcon color='gray.300' />
                        </InputLeftElement>
                        <FormLabel>Phone Number</FormLabel>
                        <Input type='tel' placeholder='Phone number' />
                    </InputGroup>  
                </Box>

            </FormControl>

        </div>
    )
}

export default Header;
